    padding: "auto",
    margin: "10px",
    borderStyle: "solid",
    boxSizing: "content-box",
    display: "block",


}
      return(
          <div style={restyle}>
       {this.state.data.map(el=>(

        <div>
        {el.quote}
        </div>

        ))}
          </div>
      );


    }


}
